import React from 'react';
import { useLocation } from 'react-router-dom';
import './LoanResult.css'; // Ensure this path is correct

const LoanResult = () => {
  const location = useLocation();
  const { formData, predictionData } = location.state;

  return (
    <div className="result-card">
      <h2>Loan Application Details</h2>
      <div className="result-section">
        <h3>Personal Information</h3>
        <p><strong>Full Name:</strong> {formData.Full_Name}</p>
        <p><strong>Address:</strong> {formData.Address}</p>
        <p><strong>PAN Number:</strong> {formData.PAN_Number}</p>
        <p><strong>Age:</strong> {formData.Age}</p>
        <p><strong>Education Level:</strong> {formData.Education_Level}</p>
        <p><strong>Marital Status:</strong> {formData.Marital_Status}</p>
        <p><strong>Dependents:</strong> {formData.Dependents}</p>
        <p><strong>Loan Purpose:</strong> {formData.Loan_Purpose}</p>
      </div>
      <div className="result-section">
        <h3>Financial Information</h3>
        {/* Add other financial information fields here */}
      </div>
      <div className="result-section">
        <h3>Prediction Result</h3>
        <p><strong>Prediction:</strong> {predictionData}</p>
      </div>
    </div>
  );
};

export default LoanResult;
